import json
import grpc
import io
import base64
import requests

import ai_process_pb2
import ai_process_pb2_grpc
from PIL import Image
import numpy as np

def log(s):
    f = open("app_client.txt", "a")
    f.write(f"{s}\n")
    f.close()

def run():

    imgs = []
    img_filename = '20200810164943_PWSUKB1WGE209A_R70_1_SolderLight_0_266_151_374_329_POLARITY.jpg'

    img_string = open('./src/gRPC/client/' + img_filename, 'rb').read()
    np_array = np.array(Image.open(io.BytesIO(img_string)))
    tmp_io = io.BytesIO()
    np.save(tmp_io, np_array)
    np_bytes = tmp_io.getvalue()
    imgs.append(np_bytes)

    input = {
        "kb_model": 'PWSUKB1WGE209A',
        "file_name": img_filename,
        "test": 'test',
        # "image" : base64.b64encode(np_bytes).decode("utf-8")
    }
    input = json.dumps(input)
    processes = [ 
        "test"
    ]

    protocol='grpc'
    if protocol=='RESTfulAPI':
        process_address = 'http://10.31.48.94:3000/v1/oneai/'
        process_address += 'pre-process'
        datas = f'"input": {input}, "processes": {json.dumps(processes)}'
        # datas = f'"processes": {json.dumps(processes)}'
        datas = "{" + datas + "}"
        # print(datas)

        response = requests.post(process_address, data=datas)
        if not response.status_code in [200, 201]:
            print(f'RESTfulAPI reply {response.status_code}')
        else:    
            print(json.loads(response.text))
        # print("response:" + response)
    else:
        # with grpc.insecure_channel('localhost:50051') as channel:
        with grpc.insecure_channel('10.41.241.230:31036') as channel:
            stub = ai_process_pb2_grpc.AIProcessStub(channel)
            response = stub.PreProcess(ai_process_pb2.ProcessRequest(input=input, processes=processes))
        
    result = {
        "error": response.error,
        "data": json.loads(response.data),
        "message": response.message
    }
    print(result)
    print(response.data)
    print(result['data']['result'])

def example_image_base64():
    image_base64_str = "data:image/png;base64,"
    return image_base64_str


if __name__ == '__main__':
    run()